import React,{useState,useEffect} from 'react';
import logo from './logo.svg';
import './App.css';

function List({props}) {
  const {picture, value, label} = props
  const[items, setItems] = useState([])

useEffect(()=>{
  setItems({picture:picture, label:label})
})
  return (
    <div className="">
      {value}
    </div>
  );
}

export default List;
